import React, { Component, Fragment } from 'react';
import Navbar from '../../componets/Navbar';
// import { Container } from './styles';
import api from '../../services/api';

export default class Property extends Component{
  constructor(props) {
    super(props)
    this.state = {
      estate: []
    }
  }
  componentDidMount() {

    api.get(`/show/id/${this.props.match.params.id}`)
      .then(res => {

        this.setState({ estate:  res.data});

      })
  }
  render(){
    return (
      <Fragment>

        <Navbar></Navbar>


      <section className="property-single-pg">
            <div className="container">
                <div className="property-hd-sec">
                    <div className="card">
                        <div className="card-body">
                            <a href="#">
                                <h3>{this.state.estate.name}</h3>
                                <p><i className="la la-map-marker"></i>nanana</p>
                            </a>
                            <ul>
                                <li>3 </li>
                                <li>2 </li>
                                <li>Area</li>
                            </ul>
                        </div>
                        <div className="rate-info">
                            <h5>$550.000</h5>
                            <span>For Rent</span>
                        </div>
                    </div>
                </div>
                </div>
                </section>
      </Fragment>

    );
  }
}
